// Basic Setup
const canvas = document.getElementById('canvas');
const ctx = canvas.getContext('2d');
const GRID = 40, TILES = 30;
canvas.width = GRID * TILES; canvas.height = GRID * TILES;
const W = TILES, H = TILES;
ctx.textAlign = "center";
ctx.textBaseline = "middle";
ctx.font = "bold 24px Arial"; // fallback font

const whiteTileImg = new Image();
whiteTileImg.crossOrigin = "anonymous";
whiteTileImg.src = window.location.protocol === 'file:' 
  ? 'data:image/png;base64,' 
  : 'tile_white.png';

const blackTileImg = new Image();
blackTileImg.crossOrigin = "anonymous";
blackTileImg.src = window.location.protocol === 'file:' 
  ? 'data:image/png;base64,' 
  : 'tile_black.png';


let allLayouts = []; let currentIndex = 0;

// Crossword Logic
function shuffle(arr) { for (let i = arr.length - 1; i > 0; i--) { const j = Math.floor(Math.random() * (i + 1)); [arr[i], arr[j]] = [arr[j], arr[i]]; } return arr; }
function createGrid() { return Array.from({ length: H }, () => Array(W).fill('')); }
function isClear(grid, r, c, v) {
  const check = (r,c) => r>=0 && c>=0 && r<H && c<W ? grid[r][c]==='' : true;
  return check(r,c) && (v ? check(r,c-1)&&check(r,c+1) : check(r-1,c)&&check(r+1,c));
}
function canPlaceVertically(grid, word, row, col) {
  if (row<0 || row+word.length>H) return false;
  if (row>0 && grid[row-1][col] !== '') return false;
  if (row+word.length<H && grid[row+word.length][col] !== '') return false;
  for (let i=0;i<word.length;i++) { const ch=grid[row+i][col]; if (ch&&ch!==word[i]) return false; if (!ch&&!isClear(grid,row+i,col,true)) return false; } return true;
}
function canPlaceHorizontally(grid, word, row, col) {
  if (col<0 || col+word.length>W) return false;
  if (col>0 && grid[row][col-1] !== '') return false;
  if (col+word.length<W && grid[row][col+word.length] !== '') return false;
  for (let i=0;i<word.length;i++) { const ch=grid[row][col+i]; if (ch&&ch!==word[i]) return false; if (!ch&&!isClear(grid,row,col+i,false)) return false; } return true;
}
function placeWordVertically(grid, word, row, col) { for (let i=0;i<word.length;i++) grid[row+i][col] = word[i]; }
function placeWordHorizontally(grid, word, row, col) { for (let i=0;i<word.length;i++) grid[row][col+i] = word[i]; }
function tryOneLayout(words, tries=500) {
  for (let attempt = 0; attempt < tries; attempt++) {
    const g = createGrid();
    const o = shuffle([...words]);
    const p = [];
    const r0 = Math.floor(H/2);
    const c0 = Math.floor((W - o[0].length) / 2);
    placeWordHorizontally(g, o[0], r0, c0);
    p.push({word: o[0], dir:'H', row: r0, col: c0});
    let failed = false;
    for (let w = 1; w < o.length; w++) {
      const word = o[w];
      let placed = false;
      const candidates = shuffle([...p]);
      for (const an of candidates) {
        const m = [];
        for (let i = 0; i < word.length; i++)
          for (let j = 0; j < an.word.length; j++)
            if (word[i] === an.word[j]) m.push([i,j]);
        shuffle(m);
        for (const [i,j] of m) {
          const nr = an.dir === 'H' ? an.row - i : an.row + j;
          const nc = an.dir === 'H' ? an.col + j : an.col - i;
          if (an.dir === 'H' && canPlaceVertically(g, word, nr, nc)) {
            placeWordVertically(g, word, nr, nc);
            p.push({word, dir:'V', row: nr, col: nc});
            placed = true;
            break;
          }
          if (an.dir === 'V' && canPlaceHorizontally(g, word, nr, nc)) {
            placeWordHorizontally(g, word, nr, nc);
            p.push({word, dir:'H', row: nr, col: nc});
            placed = true;
            break;
          }
        }
        if (placed) break;
      }
      if (!placed) { failed = true; break; }
    }
    if (!failed) return g;
  }
  return null;
}

function findAllFullLayouts(words, maxLayouts = 50, maxAttempts = 500) {
  const layouts = [], seen = new Set();
  let attempts = 0;
  while (attempts++ < maxAttempts && layouts.length < maxLayouts) {
    const g = tryOneLayout(words);
    if (!g) break;
    const hash = g.flat().join('');
    if (!seen.has(hash)) {
      seen.add(hash);
      layouts.push(g);
    }
  }
  return layouts;
}

function countLettersAndFrame(g) {
  let minR=H,maxR=0,minC=W,maxC=0,letters=0;
  g.forEach((row,r)=>row.forEach((ch,c)=>{ if(ch){ letters++; minR=Math.min(minR,r); maxR=Math.max(maxR,r); minC=Math.min(minC,c); maxC=Math.max(maxC,c); } }));
  const w=maxC-minC+1, h=maxR-minR+1; return { letters, width: w, height: h, frame4: `${w*4} x ${h*4}`, frame6: `${w*6} x ${h*6}` };
}
function draw(g) {
  const combo = document.querySelector('input[name="style"]:checked').value;
  const tileImg = combo === "white" ? whiteTileImg : blackTileImg;
  const letterColor = combo === "white" ? "#000" : "#fff";

  // Clear canvas
  ctx.fillStyle = combo === "white" ? "#fff" : "#000";
  ctx.fillRect(0, 0, canvas.width, canvas.height);

  g.forEach((row, r) => {
    row.forEach((ch, c) => {
      if (ch) {
        const x = c * GRID;
        const y = r * GRID;
        // Draw background tile image
        ctx.drawImage(tileImg, x, y, GRID, GRID);
        // Optional: Shadow text effect
        ctx.fillStyle = "rgba(0,0,0,0.2)";
        ctx.fillText(ch, x + GRID / 2 + 1, y + GRID / 2 + 1);
        ctx.fillStyle = letterColor;
        ctx.fillText(ch, x + GRID / 2, y + GRID / 2);
      }
    });
  });
}


document.getElementById('gen').onclick = () => {
  const words = document.getElementById('words').value.toUpperCase().split(/\s+/).filter(Boolean);
  if (!words.length) return alert("Enter words!");
  
  allLayouts = findAllFullLayouts(words);
  if (!allLayouts.length) return alert("No full layouts found.");
  
  // draw current first layout
  draw(allLayouts[currentIndex]);

  // calculate layout info for display
  const g = allLayouts[currentIndex];  // FIX: don't use incremented index
  const i = countLettersAndFrame(g);
  document.getElementById('status').innerText = `Letters: ${i.letters}\n4cm: ${i.frame4} cm\n6cm: ${i.frame6} cm\nLayout ${currentIndex + 1} of ${allLayouts.length}`;

  // NOW increment for next cycle
  currentIndex = (currentIndex + 1) % allLayouts.length;
};


document.getElementById('calc').onclick = () => {
  if (allLayouts.length === 0) return alert("Generate first!");
  const g = allLayouts[(currentIndex - 1 + allLayouts.length) % allLayouts.length];
  const i = countLettersAndFrame(g);
  const tiles = i.letters;
  const w_cells = parseFloat(i.width);
  const h_cells = parseFloat(i.height);

  const boardUnit = parseFloat(document.getElementById('boardUnit').value),
        frameUnit = parseFloat(document.getElementById('frameUnit').value),
        tile4cm = parseFloat(document.getElementById('tile4cm').value),
        tile6cm = parseFloat(document.getElementById('tile6cm').value),
        profit4cm = parseFloat(document.getElementById('profit4cm').value),
        profit6cm = parseFloat(document.getElementById('profit6cm').value);
  const smallBlackExtra = parseFloat(document.getElementById('smallBlackExtra').value);
  const bigBlackExtra = parseFloat(document.getElementById('bigBlackExtra').value);

  const h4 = h_cells * 4 + 20;
  const w4 = w_cells * 4 + 8;
  const h6 = h_cells * 6 + 20;
  const w6 = w_cells * 6 + 8;

  const boardCost4 = boardUnit * h4 * w4;
  const frameCost4 = frameUnit * (2*h4 + 2*w4 + 10);
  const tileCost4 = tile4cm * tiles;
  const labourCost = parseFloat(document.getElementById('labourCost').value);
  const miscCost    = parseFloat(document.getElementById('miscCost').value);
  const baseCost4   = boardCost4 + frameCost4 + labourCost + miscCost;
  const marginCost4 = Math.round(baseCost4 * (1 + profit4cm/100));
  const sell4       = marginCost4 + tileCost4;

  const boardCost6 = boardUnit * h6 * w6;
  const frameCost6 = frameUnit * (2*h6 + 2*w6 + 10);
  const tileCost6 = tile6cm * tiles;
  // reuse labourCost and miscCost defined above
  const baseCost6   = boardCost6 + frameCost6 + labourCost + miscCost;
  const marginCost6 = Math.round(baseCost6 * (1 + profit6cm/100));
  const sell6       = marginCost6 + tileCost6;

  const smallBlackPrice = sell4 + smallBlackExtra;
  const bigBlackPrice = sell6 + bigBlackExtra;

  document.getElementById('price').innerText =
    ` Below is the Scrabble Family Name Art price detail :)

` +
    `Small Frame
` +
    `  White Combo Frame (RM ${sell4})
` +
    `  Black Combo Frame (RM ${smallBlackPrice})
` +
    ` Size: Approx. ${h4}cm (H) x ${w4}cm (W)

` +
    `Big Frame
` +
    `  White Combo Frame (RM ${sell6})
` +
    `  Black Combo Frame (RM ${bigBlackPrice})
` +
    ` Size: Approx. ${h6}cm (H) x ${w6}cm (W)

   ` +
    ` Delivery: Standard: 10-15 days (Express available upon request)
` +
    ` Payment: Bank Transfer (DuitNow)

` +
    `To Proceed:
` +
    ` Confirm Frame Color combination (black/white) 
` +
    ` Choose size (big/small)
` +
    ` Choose the name combination Option
` +
    ` Choose a Title (Choose from our list)
` +
    ` Provide Your Delivery Address
` +
    `Once confirmed, I'll share payment details. Let me know if you have any questions! `;

};
 document.getElementById('save').onclick = () => {
  const nameInput = document.getElementById('customerName');
  const customerName = nameInput ? nameInput.value.trim() || 'crossword' : 'crossword';
  
  const link = document.createElement('a');
  link.download = `${customerName}_crossword.png`;
  link.href = canvas.toDataURL();
  link.click();
};

